import bisect
from typing import List


class Solution:
    def halveArray(self, nums: List[int]) -> int:
        sub_sum = sum(nums) / 2
        cnt = 0
        nums.sort()
        target = 0
        while target < sub_sum:
            k = nums[-1] / 2
            target += k
            nums.pop()
            nums.insert(bisect.bisect_right(nums, k), k)
            cnt += 1
        return cnt


